import PropTypes from 'prop-types';
import logo from '../../assets/images/logo.svg';

const Header = props => {
    const solutions = [
        {
            name: 'Insights',
            description: 'Measure actions your users take',
            href: '##',
        },
    ];

    return (
        <div className='bg-red-100 w-full fixed flex flex-row-reverse pl-72 pr-10 py-8'>
            <a href='#' className='block relative'>
                <img src={logo} className='mx-auto object-cover rounded-full w-12' alt='profile' />
            </a>
        </div>
    );
};

Header.propTypes = {};

export default Header;
